public static int lengthOfLongestSubstring (String s) {
      int opt = findOpt(s);
      System.out.println(opt);
      return opt;
   }

   private static int findOpt (String s) {
      /**
       * initialize the hashmap;
       */

      HashMap<Integer, Integer> opt = new HashMap<Integer, Integer>();
      HashMap<Integer, Integer> lastSeen = new HashMap<Integer, Integer>();
//      for (int n = 0; n < ; n++) {
//         lastSeen.put(n, -1);
//         opt.put(n, -1);
//      }


      int j = -1;
      for (int i = 0; i < s.length(); i++) {
         int thisChar = s.charAt(i);
         String slidingWindow = "";
         String i_str = s.substring(0, i + 1);
         String j_str = s.substring(0, j + 1);
         if (i > 0 && s.charAt(i) == s.charAt(i - 1)) {
            slidingWindow = "adjacent";
         } else if (lastSeen.getOrDefault(thisChar, -1) > j) {
            slidingWindow = "apart";
         } else if (j==-1){
            slidingWindow = "apart";
         } else {
            opt.put(i, i-j);
         }
         switch (slidingWindow) {
            case "adjacent":
               j = i-1;
            case "apart":
               if ((i - j) > opt.getOrDefault(i, -1)) {
                  j = lastSeen.getOrDefault(thisChar, -1);
                  opt.put(i, (i - j));
               }
            default:
               String handleDefault = "ignored";
         }
         lastSeen.put(thisChar, i);
      }
      return getMax(opt, s.length());
   }

   private static int getMax (HashMap<Integer, Integer> opt, int sLen) {
      int max = 0;

      for (int k = 0; k < opt.size(); k++) {
         if (opt.get(k) > max) {
            max = opt.get(k);
         }
      }
      if (sLen == 1) {
         return 1;
      } else {
         return max;
      }
}

